import React from 'react';
import './Home.css';
import { TweenMax } from 'gsap';

// Return logo avatar image
export default function RetuRnlOgo() {

 React.useEffect(() => {

  TweenMax.from('.wrp-logo img', 1.5, { delay: 1, opacity: 0, y: '-80', ease: Expo.ease })

 }, []);

 return (
  <div className='wrp-logo'>
   <img src={'/img/logo.png'} alt='logo view alliance pour le changement' />
  </div>
 );
}
